import logo from './logo.svg';
import './App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

function App() {
  return (
    <div className="App">
      <div className="Header">
        <p className="TextHeader">DCRP</p>
      </div>
      <FontAwesomeIcon icon={["far", "coffee"]}/>
    </div>
  );
}

export default App;
